import "./App.css";
import ServiceList from "./components/ServiceList";
import AddService from "../src/components/AddService";
import { Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Link to="/">Serice List</Link>

      <AddService />
      <ServiceList />
    </div>
  );
}

export default App;
